import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import './App.css';

function App() {
  return (
    <div className="App">
      <Container>
        <Row>
          <Col>AC</Col>
          <Col>/</Col>
          <Col>x</Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
